import React from "react";
import { ThemeProvider } from "styled-components";
import Home from "./pages/Home";
import theme from "./styles/theme";
const App = () => {

  return (
    <ThemeProvider theme={theme}>
      <Home />
    </ThemeProvider>
  );
};

export default App;
